exports=async function(url,bid,cid,options){const{parseContent,trimBeforeContent}=await require("transcode/parse_content");return parseContent(url,{cleaner:html=>{html=html.substring(html.indexOf(">\u8FD4\u56DE\u76EE\u5F55<")+6,html.lastIndexOf(">\u8FD4\u56DE\u76EE\u5F55<")),html.substring(html.indexOf("</div>")+6);let i=html.lastIndexOf("</table>");return -1!==i&&(html=html.substring(i+8)),html=html.substring(0,html.lastIndexOf("</div>")),html}},{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}})};